import React from 'react';
import {
    View,
    Image,
} from 'react-native';
import styles from '../styles/MenuIcon.style';

const MenuBar = () => {
    return (
        <View style={styles.container}>
            <Image style={styles.menuIcon} source={MENU_WHITE} />
        </View>
    );
}

export default MenuBar;
